import "./DestinationStyles.css";

function DestinationData(props){
    return(
        <div className="t-card">
            <div className="t-image">
                <img src={props.image} alt="image"></img>
            </div>
            <h5>{props.heading}</h5>
            <p>{props.text}</p>
            
        </div>
    );
}

export default DestinationData;
